import { useEffect, useState } from "react";
import axios from "axios";

const InvoicePage = () => {
  const [invoices, setInvoices] = useState([]);

  useEffect(() => {
    axios.get("/api/invoices").then((res) => setInvoices(res.data));
  }, []);

  return (
    <div>
      <h2>Invoices</h2>
      <table>
        <thead>
          <tr>
            <th>Store</th>
            <th>Order ID</th>
            <th>Date</th>
            <th>Quantity</th>
            <th>Deal Price</th>
            <th>Total (Before Tax)</th>
            <th>Total (With Tax)</th>
          </tr>
        </thead>
        <tbody>
          {invoices.map((invoice) => (
            <tr key={invoice.id}>
              <td>{invoice.storeName}</td>
              <td>{invoice.orderId}</td>
              <td>{invoice.date}</td>
              <td>{invoice.quantity}</td>
              <td>{invoice.dealPrice}</td>
              <td>{invoice.totalWithoutTax}</td>
              <td>{invoice.totalWithTax}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default InvoicePage;
